import { SET_VISIBILITY_FILTER, SHOW_BY_TEXT } from "../VisibilityFilterReducer/actionsTypes"

export const getProductsByText = (value) => {
  return {
    type: SHOW_BY_TEXT,
    payload: value
  }
}
